void start_measure(void)
{
	if(!(meas_control & __MEAS_IN_PROGRESS))
	{
		meas_control |= __ULN1_MASK; //postavi zastavico za meritev
		meas_control |= __ULN2_MASK; //postavi zastavico za meritev
		meas_control |= __ULN3_MASK; //postavi zastavico za meritev
		meas_control |= __IL1_MASK; //postavi zastavico za meritev
		meas_control |= __IL2_MASK; //postavi zastavico za meritev
		meas_control |= __IL3_MASK; //postavi zastavico za meritev
		meas_control |= __MULTIMODE_MASK; //postavi zastavico za meritev
		meas_control |= __IDIFF_MASK; //postavi zastavico za meritev
		meas_control |= __UL1PE_MASK; //postavi zastavico za meritev
		meas_control |= __UNPE_MASK; //postavi zastavico za meritev
		compute_control2 |= __POWER_MEAS_ON;
		IL_setGain(IL1_CHANNEL, __GAIN40);
		IL_setGain(IL2_CHANNEL, __GAIN40);
		IL_setGain(IL3_CHANNEL, __GAIN40);
		SDADC1_ch_cnt=0;
		SDADC2_ch_cnt=0;
		set_SDADC_zero();
		input_START_measure();
		meas_control |= __MEAS_IN_PROGRESS;
		#if THD_COMPUTATION_METHOD == CORELATION
		set_timer(MEASURING_TASK, 20,measuring_task);
		compute_control |= __IL1_THD_SAMPLING;
		#else 
		set_timer(MEASURING_TASK_FFT, 20,measuring_task_fft);
		//meas_control |= __THD_SYNCHRO_ON; //vklop sinhronizacije THD-ja-- tole se ne dela cist
		current_THD_sampling=__IL1_THD_SAMPLING;
		if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL1_THD_START;
		else compute_control |= __IL1_THD_SAMPLING;
		meas_control |= __THD_MEASURING;
		#endif
		current_THD_sampling = __IL1_THD_SAMPLING;
		HAL_NVIC_EnableIRQ(EXTI9_5_IRQn);	//vklopi interrupt na sinhronizacijo
		__DSB();
		__ISB();
		//zarnkrat tole - pol bo treba vretn zbrisat
		set_timer(TRANSMIT_RESULTS,30,Transmit_results_task);
	}
}
