		meas_control |= __NO_THD_MEAS;
		compute_control2 |= __POWER_MEAS_ON;
		IL_setGain(IL1_CHANNEL, __GAIN1);
		IL_setGain(IL2_CHANNEL, __GAIN1);
		IL_setGain(IL3_CHANNEL, __GAIN1);
