//to funkcijo bomo uporabljali ce bomo racunali THD s korelacijo
void compute_THD_with_corelation(void)
{
	uint32_t i, j;
	float temp1, temp2, temp3;
	const float * table_ptr;
	float * table_ptr2;
	static uint32_t event_count=0;
	float THD_sum=0;
	#if THD_COMPUTATION_METHOD==CORELATION
	//razdeli prehode na vec eventov, da ne zabase operacijskega sistema
	if(event_count<4)
	{
		for(i=(event_count*10); i<((event_count*10)+10);i++)
		{
			table_ptr=&correlation_table_sin[0]+(i*200);
			table_ptr2=THD_inst_buffer;
			//arm_correlate_f32(THD_buffer1,CORELATION_THD_BUFFER_SIZE,(float *)table_ptr, 200,THD_correlation_buffer);
			//kopiranje 200 vzorcev na 1000 mest najprej za sinus
			for(j=1;j<5;j++)
			{
				arm_copy_f32((float *)table_ptr,table_ptr2,200);
				table_ptr2+=(j+200);
			}
			arm_mult_f32(THD_inst_buffer,THD_buffer1,THD_correlation_buffer,CORELATION_THD_BUFFER_SIZE);
			arm_mean_f32(THD_correlation_buffer,CORELATION_THD_BUFFER_SIZE,&temp1);
			//nato se za kosinus
			table_ptr=&correlation_table_cos[0]+(i*200);
			for(j=1;j<5;j++)
			{
				arm_copy_f32((float *)table_ptr,table_ptr2,200);
				table_ptr2+=(j+200);
			}
			arm_mult_f32(THD_inst_buffer,THD_buffer1,THD_correlation_buffer,CORELATION_THD_BUFFER_SIZE);
			arm_mean_f32(THD_correlation_buffer,CORELATION_THD_BUFFER_SIZE,&temp2);
			//-------vektorsko sestevanje-----
			temp3=(temp1*temp1)+(temp2*temp2);
			arm_sqrt_f32(temp3,&temp1);
			//--------------------------------
			THD_temp_buffer[i]=temp1;
		}
	}
	#endif
	if(event_count>=4)
	{
		//-------racunanje THD-ja----------------
		for(i=1;i<40;i++)
		{
			THD_sum+=(THD_temp_buffer[i]*THD_temp_buffer[i]);
		}
		arm_sqrt_f32(THD_sum,&temp1);
		if(THD_temp_buffer[0]!=0) calculated_THD=temp1/THD_temp_buffer[0];
		//--------------------------------------------
		switch (current_THD_sampling)
		{
			case __ULN1_THD_SAMPLING:
				write_THD(calculated_THD,ULN1_THD);
				current_THD_sampling=__ULN2_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN2_THD_START;
				else compute_control |= __ULN2_THD_SAMPLING;
				compute_control &= (~__ULN1_THD_SAMPLED);
				break;
			case __ULN2_THD_SAMPLING:
				write_THD(calculated_THD,ULN2_THD);
				current_THD_sampling=__ULN3_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN3_THD_START;
				else compute_control |= __ULN3_THD_SAMPLING;
				compute_control &= (~__ULN2_THD_SAMPLED);
				break;
			case __ULN3_THD_SAMPLING:
				write_THD(calculated_THD,ULN3_THD);
				current_THD_sampling=__IL1_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL1_THD_START;
				else compute_control |= __IL1_THD_SAMPLING;
				compute_control &= (~__ULN3_THD_SAMPLED);
				break;
			case __IL1_THD_SAMPLING:
				write_THD(calculated_THD,IL1_THD);
				current_THD_sampling=__IL2_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL2_THD_START;
				else compute_control |= __IL2_THD_SAMPLING;
				compute_control &= (~__IL1_THD_SAMPLED);
				break;
			case __IL2_THD_SAMPLING:
				write_THD(calculated_THD,IL2_THD);
				current_THD_sampling=__IL3_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL3_THD_START;
				else compute_control |= __IL3_THD_SAMPLING;
				compute_control &= (~__IL2_THD_SAMPLED);
				break;
			case __IL3_THD_SAMPLING:
				write_THD(calculated_THD,IL3_THD);
				current_THD_sampling=__ULN1_THD_SAMPLING;
				if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN1_THD_START;
				else compute_control |= __ULN1_THD_SAMPLING;
				compute_control &= (~__IL3_THD_SAMPLED);
				break;
			default:
				break;
		}
		event_count=0;
	}
	else 
	{
		event_count++;
		set_timer(COMPUTE_THD_WITH_CORELATION,2,compute_THD_with_corelation);
	}
}
void compute_THD_with_FFT(void)
{
	uint32_t i;
	int o;
	int f;
	int fs=5555;	//vzorcevalna frekvenca
	float fsnaminus1;
	float l;
	float h;
	float temp1;
	float THD_sum=0;
	fsnaminus1=1.0f/((float)fs);
	////OD TLE O-> 
	//ce vzamemo manj vzorcev kot je dolzina bufferja doda nicle do konca
	if((FFT_SAMPLE_NUMBER+1)<FFT_THD_BUFFER_SIZE) 
	{
		for(i=((FFT_SAMPLE_NUMBER+1)*2);i<(FFT_THD_BUFFER_SIZE*2);i++)
		{
			THD_buffer1[i]=0;
		}
	}
	arm_cfft_f32(&arm_cfft_sR_f32_len1024,THD_buffer1,0,FFT_BIT_REVERSE);//fft bini se pojavijo v vhodnem bufferju
	arm_cmplx_mag_f32(THD_buffer1, FFT_output, FFT_THD_BUFFER_SIZE);
	//kvadratna interpolacija
	for(i=0;i<40;i++)
	{
		f=50*(i+1);
		o=f*FFT_THD_BUFFER_SIZE*fsnaminus1;
		l=f*FFT_THD_BUFFER_SIZE*fsnaminus1-(float)o;
		h=1-l;
		temp1=(l*l)/(h*h);
		THD_temp_buffer[i]=((FFT_output[o]-(temp1*FFT_output[o+1]))/(1-temp1));
	}
	for(i=1;i<40;i++)
	{
		THD_sum+=(THD_temp_buffer[i]*THD_temp_buffer[i]);
	}
	arm_sqrt_f32(THD_sum,&temp1);
	if(THD_temp_buffer[0]!=0) calculated_THD=temp1/THD_temp_buffer[0];
	switch (current_THD_sampling)
  {
  	case __ULN1_THD_SAMPLING:
			meas_control &= (~__ULN_THD_MEASURED);
			write_THD(calculated_THD,ULN1_THD);
			current_THD_sampling=__ULN2_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN2_THD_START;
			else compute_control |= __ULN2_THD_SAMPLING;
			compute_control &= (~__ULN1_THD_SAMPLED);
  		break;
  	case __ULN2_THD_SAMPLING:
			meas_control &= (~__ULN_THD_MEASURED);
			write_THD(calculated_THD,ULN2_THD);
			current_THD_sampling=__ULN3_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN3_THD_START;
			else compute_control |= __ULN3_THD_SAMPLING;
			compute_control &= (~__ULN2_THD_SAMPLED);
  		break;
		case __ULN3_THD_SAMPLING:
			meas_control &= (~__ULN_THD_MEASURED);
			write_THD(calculated_THD,ULN3_THD);
			current_THD_sampling=__IL1_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL1_THD_START;
			else compute_control |= __IL1_THD_SAMPLING;
			compute_control &= (~__ULN3_THD_SAMPLED);
  		break;
		case __IL1_THD_SAMPLING:
			meas_control &= (~__IL_THD_MEASURED);
			write_THD(calculated_THD,IL1_THD);
			current_THD_sampling=__IL2_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL2_THD_START;
			else compute_control |= __IL2_THD_SAMPLING;
			compute_control &= (~__IL1_THD_SAMPLED);
  		break;
		case __IL2_THD_SAMPLING:
			meas_control &= (~__IL_THD_MEASURED);
			write_THD(calculated_THD,IL2_THD);
			current_THD_sampling=__IL3_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __IL3_THD_START;
			else compute_control |= __IL3_THD_SAMPLING;
			compute_control &= (~__IL2_THD_SAMPLED);
  		break;
		case __IL3_THD_SAMPLING:
			meas_control &= (~__IL_THD_MEASURED);
			write_THD(calculated_THD,IL3_THD);
			current_THD_sampling=__ULN1_THD_SAMPLING;
			if(meas_control & __THD_SYNCHRO_ON) compute_control |= __ULN1_THD_START;
			else compute_control |= __ULN1_THD_SAMPLING;
			compute_control &= (~__IL3_THD_SAMPLED);
  		break;
  	default:
  		break;
  }
	//DO TLE <-O CCA 6,5ms
	//racunanje THD-ja
	//9. bin bi mogla bit nasa osnavna harmonska komponenta
}

//task za merjenje mains napetosti ce je vse ok
//izvaja se cca 300ms da dobimo rezultat ki je shranjen v global_control registru
void power_on_test(void)
{
	static uint32_t init_test_counter=0;
	float temp1, temp2, temp3, temp4, temp5;
//	global_control &= (~(__ULN3_OUT_OF_RANGE|__ULN2_OUT_OF_RANGE|__ULN1_OUT_OF_RANGE|__INIT_TEST_FAIL|__3P_CONNECTION|__1P_CONNECTION|__PE_DISCONNECTED|
//										__WRONG_CONNECTION|__VOLTAGES_IN_PHASE|__INPUT_PHASES_DET|__ON_TEST_IN_PROG|__IN_CONNECTION_OK|__INIT_TEST_PASS|__N_DISCONECTED));
//	compute_control2 &=(~(__INIT_MEASURED));
	if(init_test_counter==0)
	{
		global_control &= (~(__ULN3_OUT_OF_RANGE|__ULN2_OUT_OF_RANGE|__ULN1_OUT_OF_RANGE|__INIT_TEST_FAIL|__3P_CONNECTION|__1P_CONNECTION|__PE_DISCONNECTED|
										__WRONG_CONNECTION|__VOLTAGES_IN_PHASE|__INPUT_PHASES_DET|__ON_TEST_IN_PROG|__IN_CONNECTION_OK|__INIT_TEST_PASS|__N_DISCONECTED));
		compute_control2 &=(~(__INIT_MEASURED));
		get_phase_seq();
		global_control |= __ON_TEST_IN_PROG;
		start_measure_no_THD();
	}
	if(compute_control2 & __INIT_MEASURED)//pocakamo, da se izmerijo vhodne napetosti
	{
		global_control &= (~(__ULN3_OUT_OF_RANGE|__ULN2_OUT_OF_RANGE|__ULN1_OUT_OF_RANGE|__INIT_TEST_FAIL|__3P_CONNECTION|__1P_CONNECTION|__PE_DISCONNECTED|
										__WRONG_CONNECTION|__IN_CONNECTION_OK|__INIT_TEST_PASS|__N_DISCONECTED|__L_ON_N|__L_ON_L));

		temp1=get_value(__UL1PE);
		temp2=get_value(__UNPE);
		temp3=get_value(__ULN2);
		temp4=get_value(__ULN3);
		temp5=get_value(__ULN1);
		//----------------------------PREVERJANJA KRITICNIH VREDNOSTI-------------------------------------------
		//preverimo ce je PE prikljucen torej: ce sta obe napetosti nekje na sredini in ce je ULN1 fazna napetost potem je velika erjetnost da ni
		//ce je PE disconnected potem ne nadaljujemo preverjanja
		if(((temp1>=INIT_PE_LOW_LIMIT)&&(temp1<=INIT_PE_HIGH_LIMIT))&&((temp2>=INIT_PE_LOW_LIMIT)&&(temp2<=INIT_PE_HIGH_LIMIT))&&(temp5>=INIT_VOLTAGE_HIGH_LIMIT))
			global_control |= __PE_DISCONNECTED;
		//preverjanje kje je faza
		else if((temp1>=INIT_VOLTAGE_HIGH_LIMIT)&&(temp2>=INIT_VOLTAGE_HIGH_LIMIT)&&(temp5<INIT_VOLTAGE_LOW_LIMIT))//FAZA NA N-ju in L-ju ali N ni prikljucen- napaka
			global_control |= __N_DISCONECTED;	//v tem primeru se aparat sploh ne bi smel vklopiti
		else if((temp1>=INIT_VOLTAGE_HIGH_LIMIT)&&(temp2<=INIT_VOLTAGE_LOW_LIMIT))	//FAZA NA L - PRAVILNO
		{
			global_control |= __L_ON_L;
			if((temp3<INIT_VOLTAGE_LOW_LIMIT)&&(temp4<INIT_VOLTAGE_LOW_LIMIT))					//ce napetosti na drugih prikljuckih ni potem je vse vredu
			{global_control |= __IN_CONNECTION_OK; global_control |= __1P_CONNECTION;}	//ker gre za ENOFAZNO prikljucitev
			else if ((temp3<INIT_VOLTAGE_LOW_LIMIT)||(temp4<INIT_VOLTAGE_LOW_LIMIT))		//samo ena od faz manjka
			{global_control |= __WRONG_CONNECTION;	global_control |= __PHASE_MISSING;}	
			else if ((global_control & __VOLTAGES_IN_PHASE)|| (global_control & __PHASE_SEQ_INPHASE))	//ce so napetosti na prikljuckih v fazi pomeni da je na vseh prikljuckih ista faza - NAPAKA
			{global_control |= __WRONG_CONNECTION;	global_control |= __3P_CONNECTION;}	
			else if (((!(global_control & __VOLTAGES_IN_PHASE))||(!(global_control & __PHASE_SEQ_INPHASE)))&&((temp3>INIT_VOLTAGE_HIGH_LIMIT)&&(temp4>INIT_VOLTAGE_HIGH_LIMIT)))	//tuki gre za trofazni sistem
			{global_control |= __IN_CONNECTION_OK; global_control |= __3P_CONNECTION;}
			else
				global_control |= __WRONG_CONNECTION;
		}
		else if((temp2>=INIT_VOLTAGE_HIGH_LIMIT)&&(temp1<=INIT_VOLTAGE_LOW_LIMIT))	//FAZA NA N - PRAVILNO ce je enofazna prikljucitev
		{
			global_control |= __L_ON_N;
			if((global_control & __VOLTAGES_IN_PHASE)||(global_control & __PHASE_SEQ_INPHASE))	//ce je faza na N potem je vse vredu ce so vse napetosti v fazi -> glej hardver
			{global_control |= __IN_CONNECTION_OK; global_control |= __1P_CONNECTION;}
			else	//ce napetosti niso v fazi je velika verjetnost da gre za trofazni sistem s fazo na N
			{global_control |= __WRONG_CONNECTION;global_control |= __3P_CONNECTION;}
		}
		else global_control |= __WRONG_CONNECTION;
		//--------------------------------------------------------------------------------------
		if(global_control & __PE_DISCONNECTED)
		{	
			set_event(SEND_WARNING_MSG,send_warning_MSG);
			global_control |= __INIT_TEST_FAIL;
		}
		else if(global_control & __N_DISCONECTED)
		{
			set_event(SEND_WARNING_MSG,send_warning_MSG);
			global_control |= __INIT_TEST_FAIL;
			set_timer(LED_BLINKING_TASK,10,led_blinking_task);
		}
		else if(global_control & __WRONG_CONNECTION)
		{
			set_event(SEND_WARNING_MSG,send_warning_MSG);
			global_control |= __INIT_TEST_FAIL;
			set_timer(LED_BLINKING_TASK,10,led_blinking_task);
		}
		else if(global_control & __IN_CONNECTION_OK)
		{
			if(global_control & __1P_CONNECTION)
			{
				if((temp5<MAINS_MINUS10)||(temp5>MAINS_PLUS10)) {global_control |= __ULN1_OUT_OF_RANGE;global_control |= __INIT_TEST_FAIL;}
			}
			else if(global_control & __3P_CONNECTION)
			{
				if((temp5<MAINS_MINUS10)||(temp5>MAINS_PLUS10)) {global_control |= __ULN1_OUT_OF_RANGE;global_control |= __INIT_TEST_FAIL;}
				if((temp3<MAINS_MINUS10)||(temp3>MAINS_PLUS10)) {global_control |= __ULN2_OUT_OF_RANGE;global_control |= __INIT_TEST_FAIL;}
				if((temp4<MAINS_MINUS10)||(temp4>MAINS_PLUS10)) {global_control |= __ULN3_OUT_OF_RANGE;global_control |= __INIT_TEST_FAIL;}
			}
			//v naslednji stavek skoci ce ni pravega zaporedja faz 3 faznega sistema
			if((global_control & __3P_CONNECTION)&&((global_control &__PHASE_SEQ_132)||(global_control &__PHASE_SEQ_UNKNOWN)||(global_control &__PHASE_SEQ_INPHASE)))
			{
				set_timer(LED_BLINKING_TASK,10,led_blinking_task);
			}
			//v naslednji if stavek skoci ce so vse napetosti v mejah
			else if(((global_control & __1P_CONNECTION)&&(!(global_control & __ULN1_OUT_OF_RANGE)))||
				((global_control & __3P_CONNECTION)&&(!(global_control & __ULN1_OUT_OF_RANGE))&&(!(global_control & __ULN2_OUT_OF_RANGE))&&(!(global_control & __ULN3_OUT_OF_RANGE))))
			{
				if(global_control & __1P_CONNECTION)	IND_1P_ON;
				else if(global_control & __3P_CONNECTION)	IND_3P_ON;
				global_control |= __INIT_TEST_PASS;
				if(set_REL(37)!=_OK) _Error_Handler(__FILE__, __LINE__);	//ko vidomo da je vse vredulahko vlkopimo rel 37 ki poveze maso iz komunikacije na procesorsko
			}
			else
			{
				set_timer(LED_BLINKING_TASK,10,led_blinking_task);
			}
		}
		stop_measure();
		global_control &= (~__ON_TEST_IN_PROG);
		global_control &= (~__INPUT_PHASES_DET);
		init_test_counter=0;
	}
	else 
	{
		restart_timer(POWER_ON_TEST,5,power_on_test);
		init_test_counter++;
	}
}

//v to funkcijo pridemo zaradi razlicnih napak v povezavi. 
//ce je mogoce definirati za kaksno povezavo gre (1P ali 3P) 
//potem utripa ena od obeh luck, ce pa povezavo ni mogoce
//definirati utripata obe
void led_blinking_task(void)
{
	static uint32_t count=0;
	if(count>=(IND_BLINKING_TIME-1)) 
	{
		if(global_control & __1P_CONNECTION) IND_1P_TOG; 
		else if(global_control & __3P_CONNECTION) IND_3P_TOG;
		else {IND_1P_TOG; IND_3P_TOG;}
		count=0;
	}
	else count++;
	set_timer(LED_BLINKING_TASK,10,led_blinking_task);	//funkcija se izvede vsakih 100 ms
}
